【アカラン エッセンシャルウォータージェルの詳細】<br>
●多機能美容保湿ジェル。化粧水・美容液・保湿液・パックがこれ1つに凝縮。<br>
●香料、着色料、防腐剤、エタノール、界面活性剤、シリコン、オイル、鉱物油、旧指定成分は一切使用していません。<br>
●お水にまでこだわり、室戸沖海洋深層水を配合。<br>
●お手持ちの化粧品と合わせてお使いいただけます。<br><br>

【使用方法】<br>
洗顔後、適量（パール2粒分）を手のひらに取り、お顔全体に優しくなじませます。<br><br>

【ご注意】<br>
○お肌に合わない場合は、ご使用をおやめください。<br>
○ご使用中又はご使用後、赤み、腫れ、かゆみ、刺激等の異常が現れた場合、ご使用を中止し、皮膚科専門医にご相談されることをお勧めします。<br>
○傷、腫れもの、湿疹等、異常がある部分のご使用はおやめください。<br>
○目に入らないようにご注意ください。目に入った場合は、こすらず、すぐに水で洗い流してください。<br>
○強くこすらないようにしてください。<br>
○清潔な手で取り扱い、使用後はしっかりとしめ、直射日光、高温多湿を避け、お子様の手の届かない所に保管してください。<br>
○開封後は、なるべくお早めにご使用ください。<br><br>

【成分】<br>
水、グリセリン、BG、ジグリセリン、トレハロース、ペンチレングリコール、アセチルヒアルロン酸Na、ヒアルロン酸Na、加水分解ヒアルロン酸、サクシニルアテロコラーゲン、加水分解コラーゲン、オキナワモズクエキス、クロレラエキス、カッコンエキス、アラントイン、リン酸アスコルビルMg、ユズエキス、アロエベラ葉エキス、グリチルリチン酸2K、1，2-ヘキサンジオール、キサンタンガム、カルボマー、水酸化K<br><br>

【内容量】<br>
120g<br><br>

【販売元】<br>
株式会社AkaraN<br>
東京都新宿区高田馬場1-6-16ユニオンビル6F<br>
お問い合わせ先：0120-983-998<br><br>

【商品区分】<br>
化粧品

<br><br><br><hr>
