【フリースト マルチエマルション モイストキープジェルの詳細】<br>
●界面活性剤不使用・高浸透・保湿持続のオールインワンジェルです。<br>
●発酵セラミド（保湿成分）配合。<br>
●肌に密着してしっとり感続く：肌の角質層のすみずみまでうるおいが行き渡ります。<br>
●20種類のエイジングケア成分配合。<br>
●化粧水・美容液・乳液・クリーム・マスク、1品5役！<br><br>

【使用方法】<br>
●専用のスパチュラで適量を手に取り、お顔全体に優しくのばしてください。<br>
●乾燥が気になる部分には特にたっぷりとなじませてください。<br><br>

【ご注意】<br>
○お肌に異常が生じていないかよく注意して使用してください。お肌に合わないときは、ご使用をおやめください。<br>
○傷やはれもの、しっしん等、異常のある部位にはお使いにならないでください。<br>
○ご使用中に赤みやはれ、かゆみ、刺激、色抜け（白斑等）や黒ずみ等の症状があらわれたときはご使用を中止し、皮膚科専門医等へご相談されることをおすすめします。そのままご使用を続けますと、症状を悪化させることがあります。<br>
○目や口に入らないようにご注意ください。入った場合は、こすらずにすぐ水またはぬるま湯で充分に洗い流してください。<br>
○すすいでも目に異物感が残る場合は、眼科医にご相談されることをおすすめします。<br>
○化粧品は清潔な手でお取扱いください。<br>
○ジェルは、専用のスパチュラでお取扱いください。<br>
○一度手に取ったジェルは、容器に戻さないでください。<br>
○ご使用後はしっかりキャップをしめてください。<br>
○乳幼児の手の届かないところに保管してください。<br>
○高温、低温、高湿度の場所、または直射日光にあたる場所には保管しないでください。<br><br>

【成分】<br>
水、BG、トリイソステアリン、ホホバ種子油、スクワラン、マカダミア種子油、アスペルギルス培養エキス液、セラミドNP、ヒアルロン酸Na、加水分解コラーゲン、カンゾウ根エキス、リン酸アスコルビルMg、アルブチン、カフェイン、プラセンタエキス、乳酸桿菌/ローヤルゼリー発酵液、クララ根エキス、クダモノトケイソウ果実エキス、アルニカ花エキス、ユズ果実エキス、オウゴン根エキス、アロエベラ葉エキス、ダイズ種子エキス、ビルベリー葉エキス、ペンチレングリコール、カルボマー、ヒドロキシプロピルメチルセルロースステアロキシエーテル、エタノール、水酸化Na、フェノキシエタノール、香料<br><br>

【内容量】<br>
120g<br><br>

【販売元】<br>
株式会社東洋新薬<br>
佐賀県鳥栖市弥生が丘7-28<br>
お客様相談室：0800-919-0085<br><br>

【商品区分】<br>
